import "./topbar.css"

export default function Topbar() {
  return (
    <div className='top'> 
    <div className="topLeft">
    <i class="fa-brands fa-facebook"></i>
    </div>
    <div className="topCenter">s</div>
    <div className="topRight">s</div>
    </div>
  )
}
